import {Routes,Route} from 'rec'
import MainPage from "./page/MainPage";
import RegistredPage from "./page/RegistredPage";

function App() {
  return (
    <Routes>
      <Route path="/" element={<MainPage />} />
      <Route path="/" element={<RegistredPage />} />
    </Routes>
  );
}
export default App;
